import Vue from 'vue'
import App from './App.vue'
import axios from 'axios'
import ElementUI from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
import router from '@/router/index'

Vue.config.productionTip = false
Vue.use(ElementUI)


new Vue({
  render: h => h(App),
  router,
  created() {
    this.$axios = axios
  }
}).$mount('#app')
